ementia and their carers. WWP has also regularly supported the Cancer Coucil by performing at Relay for Life events.</p>\n<p> WWP is always looking for more performance oppurtunities so please contact us if you would like us at your next event !</p>\n<h2><img src=\"assets/cameraclipart_2.png\" width=\"150\" height=\"127\" alt=\"\" title=\"\"/> <a href=\"[sitetree_link id=29]\">Photos of Wallarah Winds &amp; Percussion</a></h2>\n</div>','Wallarah Winds and Percussion',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Published',NULL,'Inherit','Inherit',NULL,6,24),(27,'Page','2012-02-02 21:14:32','2012-02-07 11:50:30','one-on-one-lessons','One-on-One Lessons',NULL,'<p>~ More information coming soon! ~</p>','One-on-One Lessons',NULL,NULL,NULL,1,1,NULL,0,3,0,0,'Published',NULL,'Inherit','Inherit',NULL,3,6),(28,'Page','2012-02-02 21:15:01','2012-02-07 11:54:16','theory-classes','Theory Classes',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>~ More information coming soon! ~</p>\n</div>','Theory Classes',NULL,NULL,NULL,1,1,NULL,0,4,0,0,'Published',NULL,'Inherit','Inherit',NULL,3,6),(20,'Page','2012-02-02 09:08:05','2012-02-16 21:55:37','calendar-of-events','Calendar of Events',NULL,'<h2>Upcoming Events</h2>\n<ul><li><span style=\"line-height: normal;\"><strong>Tuesday 21st Febuary, WWP performing at Camp Breakaway 7.00-8.00pm</strong></span></li>\n<li><strong>End of term 1(TBA) NVHS Music from Glee.</strong></li>\n<li><strong>25th April. ANZAC day. WWP at Toukley, GHS at Wyong, NVHS at Gosford.</strong></li>\n</ul><div id=\"pastEvents\">\n<h2>Past Events</h2>\n<ul><li style=\"list-style: initial;\"><strong>9 AUG</strong> Camp Breakaway Concert - Carers of Dementia</li>\n<li style=\"list-style: initial;\"><strong>20 SEPT</strong> Camp Breakaway Concert - Carers of Dementia</li>\n</ul></div>','Calendar of Events',NULL,NULL,NULL,1,1,NULL,0,3,0,0,'Published',NULL,'Inherit','Inherit',NULL,16,0),(21,'Page','2012-02-02 09:10:42','2012-02-16 21:51:37','enrolment-and-enquiries','Enrolment and Enquiries','Enrolment','<p>Download <a href=\"assets/ENROLMENT-FORM-School-and-Community-Music-2012.pdf\" target=\"_blank\">enrolment form</a></p>','Enrolment and Enquiries',NULL,NULL,NULL,1,1,NULL,0,7,0,0,'Published',NULL,'Inherit','Inherit',NULL,9,0),(22,'Page','2012-02-02 09:11:57','2012-02-02 21:26:26','newsletters','Newsletters',NULL,'<p>~ Coming Soon ~</p>','Newsletters',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Published',NULL,'Inherit','Inherit',NULL,7,6),(23,'Page','2012-02-02 09:12:21','2012-02-14 11:04:10','staff','Staff',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<h3>Rowen McBride</h3>\n<p>Conductor and brass tutor</p>\n<h3>Jessica McBride</h3>\n<p>Flute and saxophone tutor</p>\n<h3>Greg Smith</h3>\n<p>Piano and  theory</p>\n<h3>Matt Kelly</h3>\n<p>Trumpet tutor</p>\n<h3>Sean Cadogan-Steele</h3>\n<p>Percussion tutor</p>\n<h3>Paul Latham</h3>\n<p>Guitar tutor</p>\n</div>','Staff',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Published',NULL,'Inherit','Inherit',NULL,10,6),(6,'Page','2012-02-02 06:53:57','2012-02-14 10:54:38','useful-information','Useful Information',NULL,'<div style=\"text-align: center;\">\n<table style=\"text-align: center;\" border=\"0\" align=\"center\"><tbody><tr><td>\n<p><a href=\"[sitetree_link id=7]\"><img class=\"center\" src=\"assets/trombone.png\" height=\"115\" alt=\"\" title=\"\"/></a></p>\n<p><a href=\"[sitetree_link id=7]\">Instrument Maintenance</a></p>\n</td>\n<td>\n<p><a href=\"[sitetree_link id=8]\"><img class=\"center\" src=\"assets/computer.png\" width=\"115\" height=\"115\" alt=\"\" title=\"\"/></a></p>\n<p><a href=\"[sitetree_link id=8]\">Useful Links</a></p>\n</td>\n</tr></tbody></table></div>','Useful Information',NULL,NULL,NULL,1,1,NULL,0,6,0,0,'Published',NULL,'Inherit','Inherit',NULL,24,0),(7,'Page','2012-02-02 06:53:57','2012-02-02 21:24:48','instrument-care-essentials','Instrument Care Essentials',NULL,NULL,'Instrument Care Instruction',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Published',NULL,'Inherit','Inherit',NULL,5,6),(9,'Page','2012-02-02 07:41:29','2012-02-14 11:03:25','trombone-maintenance','Trombone Maintenance',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>Insert mouthpiece gently! Do not \"pop\" in with your hand or put excess pressure on mouthpiece. Simply twist gently into place.</p>\n<p>You must be gentle with the slide! Do not bump or drop the slide, even the smallest of dints can restrict slide movement or stop it from working.</p>\n<p>You will need:</p>\n<ul><li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Slide Cream</span> - Take the outer slide off being careful not to bump it, apply a <strong>small</strong> amount of cream to the end of the slide stocks. Put the outer slide back on the right way, ensuring the water key is facing down, and run it up and down a few times.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Spray Bottle</span> - Spray the slide regularly with water to keep it running smooth.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Snake</span> - Clean your trombone on a monthly basis. Use the snake for the inside of the slide using warm water (never hot) and mild soap.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Mouthpiece brush</span> - cleans your mouthpiece with warm (never hot) water and mild soap.</li>\n</ul></div>','Trombone Maintenance',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Published',NULL,'Inherit','Inherit',NULL,5,7),(8,'Page','2012-02-02 06:55:04','2012-02-14 11:04:20','useful-links','Useful Links',NULL,'<p>Sax and Woodwind - Brass and woodwind instruments and accessories<br style=\"color: #008000; font-family: arial, helvetica, sans-serif; font-size: 13px; line-height: 17px; text-align: left; padding: 0px; margin: 0px;\"/><a style=\"color: #000000; font-family: arial, helvetica, sans-serif; font-size: 13px; line-height: 17px; text-align: left; padding: 0px; margin: 0px;\" href=\"http://www.saxandwoodwind.com.au/\">www.<strong style=\"padding: 0px; margin: 0px;\">saxandwoodwind</strong>.com.au</a></p>\n<p>Emotemuse<br/><a href=\"http://www.emotemuse.com/g/s/index.php\">www.emotemuse.com/g/s/index.php</a></p>\n<p>Sean Cadogan-Steele<br/><a href=\"http://www.steeledrums.com/\">www.steeledrums.com</a></p>','Useful Links',NULL,NULL,NULL,1,1,NULL,0,6,0,0,'Published',NULL,'Inherit','Inherit',NULL,7,6),(10,'Page','2012-02-02 07:42:30','2012-02-14 11:03:35','trumpet-maintenance','Trumpet Maintenance',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>Insert mouthpiece gently! Do not \"pop\" in with your hand or put excess pressure on mouthpiece. Simply twist gently into place.</p>\n<p>You will need:</p>\n<ul><li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Valve Oil</span> - Take each valve out and apply a few drops of oil before each time you play. This reduces friction, corrosion and prevents the valve from seizing so you can perform your best every time without having to stop to apply oil.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Snake</span> - Clean your trumpet on a monthly basis. Use the snake for the inside of the trumpet with warm water (never hot) and mild soap.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Mouthpiece brush</span> - cleans your mouthpiece with warm (never hot) water and mild soap.</li>\n</ul></div>','Trumpet Maintenance',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Published',NULL,'Inherit','Inherit',NULL,5,7),(11,'Page','2012-02-02 07:43:02','2012-02-07 04:32:14','clarinet-maintenance','Clarinet Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Pull- through</span> - This is basically a piece of string with a weight on one end which you drop down your instrument and pull the cloth on the other end through. All good music shops should sell these, or you can make one yourself!</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li><span style=\"text-decoration: underline;\">Cork Grease</span> - You will need to rub some cork grease on the cork parts of your instrument from time to time when you are setting it up. This needs to be done when your corks are dry to prevent them from cracking and breaking.</li>\n</ul>','Clarinet Maintenance',NULL,NULL,NULL,1,1,NULL,0,3,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,7),(12,'Page','2012-02-02 07:43:39','2012-02-07 04:32:44','saxophone-maintenance','Saxophone Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff, books music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Pull- through</span> - This is basically a piece of string with a weight on one end, which you drop down your instrument and pull the cloth on the other end through. All good music shops should sell these, or you can make one yourself!</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li><span style=\"text-decoration: underline;\">Cork Grease</span> - You will need to rub some cork grease on the cork parts of your instrument from time to time when you are setting it up. This needs to be done when your corks are dry to prevent them from cracking and breaking.</li>\n</ul>','Saxophone Maintenance',NULL,NULL,NULL,1,1,NULL,0,4,0,0,'Published',NULL,'Inherit','Inherit',NULL,3,7),(13,'Page','2012-02-02 07:44:05','2012-02-07 04:33:15','flute-maintenance','Flute Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Cleaning rod</span> - This generally comes in the case with the instrument when purchased.</li>\n<li><span style=\"text-decoration: underline;\">Cleaning cloth</span> - Used to wrap around the cleaning rod and to be wiped through your instrument after each use. A small hankerchief or similar can be used for this. This is an extremely important part of caring from your instrument to avoid moisture build up and to prevent breakdown of keypads etc, not to mention germs!!</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the silver/ nickel on your instrument. It also makes your instrument clean and shiny!</li>\n</ul>','Flute Maintenance',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Published',NULL,'Inherit','Inherit',NULL,3,7),(31,'Page','2012-02-07 04:46:06','2012-02-13 08:51:06','gorokan-high-school','Gorokan High School',NULL,'<p>Here\'s <strong>some</strong> info!</p>','Gorokan High School',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,14),(32,'Page','2012-02-07 05:11:11','2012-02-07 11:39:19','profiles','Profiles',NULL,NULL,'Profiles',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,5,26),(33,'Page','2012-02-07 05:12:30','2012-02-10 04:21:22','patrick-dow','Patrick Dow',NULL,'<p>Patrick Dow (aka Patrico Wah) obviously like posing for the camera but in his spare time he has been playing the Tuba for the last few month and boy what a difference that makes to the low brass section.</p>\n<p>Pat has played in heaps of bands previously - too many to list.</p>\n<p>His memorable musical moments include - playing with Elliot Randal (Guitarist) of Steely Dan and performing with an 8 piece band with own material at album launch.</p>\n<p>Pat likes playing with WWP as he is learning something new and it makes him approach music from a different angle and he gets to play alongside his daughter Madeleine.</p>\n<p>Pat has been a pro musician for almost 30 years and continues to enjoy his music no matter what it is.','Patrick Dow',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(29,'Page','2012-02-07 04:39:52','2012-02-07 04:41:05','photos-of-wallarah-winds-and-percussion','Photos of Wallarah Winds & Percussion',NULL,'<p><img class=\"left\" src=\"assets/imgp1443smaller.jpg\" width=\"473\" height=\"317\" alt=\"\" title=\"\"/></p>\n<p>Wallarah Winds and Percussion - June 2009</p>','Photos of Wallarah Winds & Percussion',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Published',NULL,'Inherit',