1,NULL,0,3,0,0,'Published',NULL,'Inherit','Inherit',NULL,3,32),(35,'Page','2012-02-07 11:34:19','2012-02-07 11:36:55','linda-pereboeff','Linda Pereboeff',NULL,'<p>Linda Pereboeff has been playing the clarinet for the past 2 years.</p>\n<p>Linda\'s most memorable music moment was playing at the ANZAC Service this year at Toukley.</p>\n<p>She likes likes playing with WWP as they are a great bunch of people.</p>','Linda Pereboeff',NULL,NULL,NULL,1,1,NULL,0,4,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(36,'Page','2012-02-07 11:34:20','2012-02-07 11:35:23','susanna-pereboeff','Susanna Pereboeff',NULL,'<p>Susanna Pereboeff has been playing with the percussion section for the past 1.5 years.</p>\n<p>She played with Kanwal Public School Band.</p>\n<p>Susanna\'s most memorable musical moment was playing at the Anzac service this year at Toukley.</p>\n<p>Susanna like playing with WWP because she enjoys the music we play and gets to see friends i wouldn\'t see if she didn\'t go to band.</p>\n<p>Susanna says that crash symbols are heaps of fun to play as she likes to make lots of noise with them.</p>','Susanna Pereboeff',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(37,'Page','2012-02-07 11:37:19','2012-02-07 11:38:18','jo-mcphan','Jo McPhan',NULL,'<p><span style=\"color: #000000; font-family: arial, helvetica, sans-serif; font-size: 13px; line-height: 17px; text-align: left;\">Jo plays the alto saxophone</span></p>','Jo McPhan',NULL,NULL,NULL,1,1,NULL,0,6,0,0,'Published',NULL,'Inherit','Inherit',NULL,2,32),(38,'Page','2012-02-07 11:37:20','2012-02-07 11:37:53','jonathon-berhandt','Jonathon Berhandt',NULL,'<p>Jonathon plays the alto saxophone</p>','Jonathon Berhandt',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(39,'Page','2012-02-07 11:39:05','2012-02-14 11:49:52','matt-kelly','Matt Kelly',NULL,'<p>Matt is Dean\'s friend :)</p>','Matt Kelly',NULL,NULL,NULL,1,1,NULL,0,15,0,0,'Published',NULL,'Inherit','Inherit',NULL,3,32),(40,'Page','2012-02-07 11:39:27','2012-02-14 11:02:53','marita-castiglione','Marita Castiglione',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p><img src=\"assets/marita-castiglione4.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>Marita Castiglione has been playing the Clarinet for the past 2 years and played in her school band in 1979!!</p>\n<p> </p>\n<p>Marita’s most memorable musical moment was playing at the Anzac Dawn Service at Toukley this year.</p>\n<p> </p>\n<p>Marita enjoys playing with WWP as it is fun and challenging and they are a great bunch of people.</p>\n</div>','Marita Castiglione',NULL,NULL,NULL,1,1,NULL,0,14,0,0,'Published',NULL,'Inherit','Inherit',NULL,5,32),(41,'Page','2012-02-07 11:39:30','2012-02-07 11:47:37','niall-waldron','Niall Waldron',NULL,'<p><img class=\"left\" src=\"assets/niall-waldron2.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>Niall Waldron plays percussion</p>','Niall Waldron',NULL,NULL,NULL,1,1,NULL,0,13,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(42,'Page','2012-02-07 11:39:32','2012-02-07 11:46:43','jean-britton','Jean Britton',NULL,'<p><img class=\"left\" src=\"assets/jean-britton2.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>Jean Britton with “Ernest” Euphonium has been playing with WWP since it began in 2008.</p>\n<p>Jean has been involved in music programs since 1998 when her eldest daughter, Bronwyn, joined Kanwal Public School Band.</p>\n<p>Jean first learnt to play the Tenor Horn with the Salvation Army in Grafton then moved onto the Baritone and Euphonium.  Jean has grown up with music learning to play the piano until age 16, did singing lessons to perform at competitions.Jean had not played any instruments for a long time (22 years) until Rowan finally let her play after she nagged him to near death.</p>\n<p>Mr Hibbard would let Jean play the trumpet every year at Toukley.  Jean has held various band committee positions with Kanwal Primary and Gorokan High School Bands and is currently President for WWP.</p>\n<p>WWP is Jean’s de-stressing therapy, to have fun, play and share great music and socialise with fellow musicians.  Jean has said for many years that we need a community band for all those musicians who have nowhere to play when they leave school – dreams do come true at last.</p>','Jean Britton',NULL,NULL,NULL,1,1,NULL,0,12,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(43,'Page','2012-02-07 11:39:33','2012-02-07 11:46:00','john-saunders','John Saunders',NULL,'<p><img class=\"left\" src=\"assets/john-saunders2.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>John Saunders plays the Bass Clarinet but is known to play many other instruments such French Horn and Clarinet.</p>\n<p>John has been playing for many years and has played with Gorokan High School Wind Orchestra and Kanwal Primary School Band.  When asked if he has any nicknames John says “You would not believe the names I have attracted from my fine scholars”!!</p>\n<p>John is instrumental in tutoring other players, organising small ensembles and always helps out where he can.  There would be many musicians who can remember playing alongside Mr Saunders and it would not be the same without him there.</p>\n<p>John’s memorable musical moment is playing in a concert in Banff with Gorokan High School Wind Orchestra and enjoys playing with WWP as it brings people together who otherwise would not be playing.</p>','John Saunders',NULL,NULL,NULL,1,1,NULL,0,11,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(44,'Page','2012-02-07 11:39:34','2012-02-14 11:02:26','madeleine-dow','Madeleine Dow',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p><img src=\"assets/madeleine-dow.jpg\" width=\"324\" height=\"483\" alt=\"\" title=\"\"/></p>\n<p>Madeleine Dow - aka Mad Maddie has been playing the Flute for 1 ½ years with Kanwal School Band. </p>\n<p>Madeleine says she likes coming to WWP because she gets to do lots of cool things and learns heaps of music.Madeleine’s most musical moment was her first solo at the Kanwal School Band concert.  Madeleine is learning to play the Tuba and the recorder but would absolutely love to play the Oboe.  Well girlfriend newsflash you only have one mouth, two hands and you will need a very big bank loan to get an Oboe.  Aim high sell lots of chocolates or just get Dad to mortgage the house.</p>\n</div>','Madeleine Dow',NULL,NULL,NULL,1,1,NULL,0,10,0,0,'Published',NULL,'Inherit','Inherit',NULL,6,32),(45,'Page','2012-02-07 11:39:36','2012-02-07 11:43:49','alberto-castiglione','Alberto Castiglione',NULL,'<p><img class=\"left\" src=\"assets/alberto-castiglione.jpg\" width=\"226\" height=\"338\" alt=\"\" title=\"\"/></p>\n<p>Alberto Castiglione has been playing the trumpet for 15 months and never thought he could learn to play an instrument as an adult, this is something Alberto always wanted to do.</p>\n<p>Alberto enjoys getting together with other players each week, having fun and learning to play great music.</p>\n<p>Alberto’s most memorable musical moment with WWP is playing at the Toukley Food and Fun Festival at Toukley this year.</p>','Alberto Castiglione',NULL,NULL,NULL,1,1,NULL,0,9,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(46,'Page','2012-02-07 11:39:37','2012-02-07 11:42:43','peter-farthing','Peter Farthing',NULL,'<p><img class=\"left\" src=\"assets/peter-farthing.jpg\" width=\"324\" height=\"483\" alt=\"\" title=\"\"/></p>\n<p>Peter Farthing plays trumpet. He started playing at age 10 then played til he was 21 then won a scholarship at the Conservatorium of Sydney Opera School.</p>\n<p>Peter has played with such groups as Auburn/Lidcombe Youth Band, Marist Bros. Parramatta and Army Cadet Corp Band.</p>\n<p>His most memorable moment was at Bicentenial celebration - Singing in male chorus with Sydney Symphony Orchestra at Sydney Opera House in the recital of Opera Zrinski.</p>\n<p>\"My family has musical roots - my grandfather sang on the Tivoli theatre circuit and my mother was a soprano. Music and theatre has been a large part of my earlier life. I also studied acting at the Ensemble Theatre (independent) in Sydney and was lucky to have a trumpet mentor in Dick Montz.</p>\n<p>After not being involved in music or theatre for a long time, playing with Wallarah Winds and Percussion is like discovering myself again, funny how life can become a full circle - Love it !!</p>','Peter Farthing',NULL,NULL,NULL,1,1,NULL,0,8,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,32),(47,'Page','2012-02-07 11:39:38','2012-02-07 11:41:48','bronwyn-cugley','Bronwyn Cugley',NULL,'<p><img class=\"left\" src=\"assets/bronwyn-cugley.jpg\" width=\"324\" height=\"483\" alt=\"\" title=\"\"/></p>\n<p>Bronwyn Cugley has played the Trumpet for the past 10 years.  Bronwyn has played with Kanwal Primary School band and Gorokan High School Wind Orchestra.  Bronwyn did play the Tuba for 12 months with Gorokan High School Wind Orchestra and assisted Gosford City Brass Band in their annual concert playing the Tuba.</p>\n<p>Bronwyn’s most memorable musical moment was performing on tour with Gorokan High School Wind Orchestra on the Outback tour in 2004.</p>\n<p>Bronwyn likes playing with WWP as it is a great environment to play music with all different types of people.  Bronwyn says she just loves being embarrassed by all the wonderful stories her mother has to tell the band,</p>\n<p><img class=\"left\" src=\"assets/smiley-smile.gif\" width=\"18\" height=\"18\" alt=\"\" title=\"\"/>thanks mum xoxo</p>','Bronwyn Cugley',NULL,NULL,NULL,1,1,NULL,0,7,0,0,'Published',NULL,'Inherit','Inherit',NULL,5,32);

