nd-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Visit thier home page! <a href=\"http://www.gorokan-p.schools.nsw.edu.au/sws/view/home.node\">Gorokan Public School Website</a></p>\n<h2>Rehearsal and tutorial times</h2>\n<h3>Gorokan Public School band rehearses:</h3>\n<p>Thursdays: 1:20-2:00pm</p>\n<h3>Gorokan Public School djembe class:</h3>\n<p>Thursdays: 1:20-2:00pm</p>\n</div>','Gorokan Public School',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Published',NULL,'Inherit','Inherit',NULL,8,14),(16,'Page','2012-02-02 08:48:12','2012-02-14 11:00:02','kanwal-public-school','Kanwal Public School',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Visit thier home page! <a title=\"http://www.kanwal-p.schools.nsw.edu.au/\" href=\"http://www.gorokan-p.schools.nsw.edu.au/sws/view/home.node\">Kanwal Public School Website</a></p>\n<h2>Rehearsal and Tutorial Times</h2>\n<h3>Kanwal Public School Band rehearses:</h3>\n<p>Tuesday afternoons: 3:00 - 4:30pm</p>\n<h3>Tutorials also take place:</h3>\n<p>Tuesday afternoons: 12:00 - 3:00pm</p>\n</div>','Kanwal Public School',NULL,NULL,NULL,1,1,NULL,0,3,0,0,'Published',NULL,'Inherit','Inherit',NULL,6,14),(17,'Page','2012-02-02 08:51:50','2012-02-14 11:00:17','narara-valley-high-school','Narara Valley High School',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Visit their band\'s homepage: <a href=\"http://www.nararavalleyhighschoolband.com/\">Narara Valley High School Band Website</a></p>\n<p>Visit their school\'s homepage: <a href=\"http://www.nararavaly-h.schools.nsw.edu.au\">Narara Valley High School Website</a></p>\n</div>','Narara Valley High School',NULL,NULL,NULL,1,1,NULL,0,4,0,0,'Published',NULL,'Inherit','Inherit',NULL,6,14),(18,'Page','2012-02-02 08:56:25','2012-02-14 11:00:25','st-joseph-s-catholic-college','St. Joseph\'s Catholic College','St. Joseph\'s College','<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Visit thier home page! <a href=\"http://www.sjcc.nsw.edu.au/default.php?pg=epages&amp;page=5\">St. Joseph\'s Catholic College</a></p>\n<h2>Rehearsal and tutorial times</h2>\n<p> </p>\n<h3>St. Joseph\'s Catholic College Band rehearses:</h3>\n<p>Monday: 8:00-9:00am</p>\n</div>','St. Joseph\'s Catholic College',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Published',NULL,'Inherit','Inherit',NULL,4,14),(26,'Page','2012-02-02 21:13:49','2012-02-14 11:00:59','wallarah-winds-and-percussion','Wallarah Winds & Percussion',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p><img src=\"assets/wwplogo2.png\" width=\"153\" height=\"162\" alt=\"\" title=\"\"/></p>\n<p>Wallarah Winds &amp; Percussion is a local community band formed by Rowen McBride in 2008. The band consists of woodwind, brass and percussion players of all ages and is always after new members! </p>\n<p>WWP plays a wide range of repertoire spanning from hymns and chorales to jazz, orchestral arrangements and popular music.</p>\n<p> The band provides hymns annually at the Toukley RSL ANZAC Day dawn and morning services and is very proud to represent at these services. Other Regular performances include those at Camp Breakaway in San Remo, which provides respite for young people with disabilities, the elderly, people with dementia and their carers. WWP has also regularly supported the Cancer Coucil by performing at Relay for Life events.</p>\n<p> WWP is always looking for more performance oppurtunities so please contact us if you would like us at your next event !</p>\n<h2><img src=\"assets/cameraclipart_2.png\" width=\"150\" height=\"127\" alt=\"\" title=\"\"/> <a href=\"[sitetree_link id=29]\">Photos of Wallarah Winds &amp; Percussion</a></h2>\n</div>','Wallarah Winds and Percussion',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Published',NULL,'Inherit','Inherit',NULL,6,24),(27,'Page','2012-02-02 21:14:32','2012-02-07 11:50:30','one-on-one-lessons','One-on-One Lessons',NULL,'<p>~ More information coming soon! ~</p>','One-on-One Lessons',NULL,NULL,NULL,1,1,NULL,0,3,0,0,'Published',NULL,'Inherit','Inherit',NULL,3,6),(28,'Page','2012-02-02 21:15:01','2012-02-07 11:54:16','theory-classes','Theory Classes',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>~ More information coming soon! ~</p>\n</div>','Theory Classes',NULL,NULL,NULL,1,1,NULL,0,4,0,0,'Published',NULL,'Inherit','Inherit',NULL,3,6),(20,'Page','2012-02-02 09:08:05','2012-02-16 21:55:37','calendar-of-events','Calendar of Events',NULL,'<h2>Upcoming Events</h2>\n<ul><li><span style=\"line-height: normal;\"><strong>Tuesday 21st Febuary, WWP performing at Camp Breakaway 7.00-8.00pm</strong></span></li>\n<li><strong>End of term 1(TBA) NVHS Music from Glee.</strong></li>\n<li><strong>25th April. ANZAC day. WWP at Toukley, GHS at Wyong, NVHS at Gosford.</strong></li>\n</ul><div id=\"pastEvents\">\n<h2>Past Events</h2>\n<ul><li style=\"list-style: initial;\"><strong>9 AUG</strong> Camp Breakaway Concert - Carers of Dementia</li>\n<li style=\"list-style: initial;\"><strong>20 SEPT</strong> Camp Breakaway Concert - Carers of Dementia</li>\n</ul></div>','Ca