ficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Cleaning rod</span>- This generally comes in the case with the instrument when purchased.</li>\n<li><span style=\"text-decoration: underline;\">Cleaning cloth</span>- Used to wrap around the cleaning rod and to be wiped through your instrument after each use. A small hankerchief or similar can be used for this. This is an extremely important part of caring from your instrument to avoid moisture build up and to prevent breakdown of keypads etc, not to mention germs!!</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span>- To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the silver/ nickel on your instrument. It also makes your instrument clean and shiny!</li>\n</ul>','Flute Maintenance',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Saved (new)',NULL,'Inherit','Inherit',NULL,7),(33,8,3,1,1,1,'Page','2012-02-02 06:55:04','2012-02-02 07:45:15','useful-links','Useful Links',NULL,'<p>Sax and Woodwind - Brass and woodwind instruments and accessories<br style=\"color: #008000; font-family: arial, helvetica, sans-serif; font-size: 13px; line-height: 17px; text-align: left; padding: 0px; margin: 0px;\"/><a style=\"color: #000000; font-family: arial, helvetica, sans-serif; font-size: 13px; line-height: 17px; text-align: left; padding: 0px; margin: 0px;\" href=\"http://www.saxandwoodwind.com.au/\">www.<strong style=\"padding: 0px; margin: 0px;\">saxandwoodwind</strong>.com.au</a></p>','Useful Links',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,6),(34,2,3,1,1,1,'Page','2012-02-02 06:40:52','2012-02-02 07:48:26','about-us','About Us',NULL,'<h3 style=\"margi