elps you grow personally. </li>\n<li> Brings families together in a fun, challenging environment! </li>\n</ul><h3>Educational:</h3>\n<ul><li> Learning to play both individually and together as a cohesive band. </li>\n<li> Provides you with a starting point to then specialise within the ensembles. E.g. Big Band, Jazz, Blues etc. </li>\n</ul>',NULL,NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,0),(85,15,5,1,1,1,'Page','2012-02-02 08:41:04','2012-02-02 21:03:42','gorokan-public-school','Gorokan Public School',NULL,'<p>Visit thier home page! <a href=\"http://www.gorokan-p.schools.nsw.edu.au/sws/view/home.node\">Gorokan Public School Website</a></p>\n<address><br/></address>\n<h2>Rehearsal and tutorial times</h2>\n<h3>Gorokan Public School band rehearses:</h3>\n<p>Thursdays:','Gorokan Public School',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,14),(86,15,6,1,1,1,'Page','2012-02-02 08:41:04','2012-02-02 21:03:54','gorokan-public-school','Gorokan Public School',NULL,'<p>Visit thier home page! <a href=\"http://www.gorokan-p.schools.nsw.edu.au/sws/view/home.node\">Gorokan Public School Website</a></p>\n<address><br/></address>\n<h2>Rehearsal and tutorial times</h2>\n<h3>Gorokan Public School band rehearses:</h3>\n<p>Thursdays:','Gorokan Public School',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,14),(87,24,1,0,1,0,'Page','2012-02-02 21:13:05','2012-02-02 21:13:05','new-page','New Page',NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL,0,12,0,0,'New page',NULL,'Inherit','Inherit',NULL,0),(88,24,2,1,1,1,'Page','2012-02-02 21:13:05','2012-02-02 21:13:14','community-music','Community Music',NULL,NULL,'Community Music',NULL,NULL,NULL,1,1,NULL,0,12,0,0,'Saved (new)',NULL,'Inherit','Inherit',NULL,0),(89,25,1,0,1,0,'Page','2012-02-02 21:13:16','2012-02-02 21:13:16','new-page','New Page',NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL,0,1,0,0,'New page',NULL,'Inherit','Inherit',NULL,24),(90,25,2,1,1,1,'P