9,4,1,1,1,'Page','2012-02-02 07:41:29','2012-02-07 04:30:40','trombone-maintenance','Trombone Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>Insert mouthpiece gently! Do not \"pop\" in with your hand or put excess pressure on mouthpiece. Simply twist gently into place.</p>\n<p>You must be gentle with the slide! Do not bump or drop the slide, even the smallest of dints can restrict slide movement or stop it from working.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Slide Cream</span>','Trombone Maintenance',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,7),(123,10,3,1,1,1,'Page','2012-02-02 07:42:30','2012-02-07 04:31:36','trumpet-maintenance','Trumpet Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>Insert mouthpiece gently! Do not \"pop\" in with your hand or put excess pressure on mouthpiece. Simply twist gently into place.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Valve Oil</span> - Take each valve out and apply a few drops of oil before each time you play. This reduces friction, corrosion and prevents the valve from seizing so you can perform your best every time without having to stop to apply oil.</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li><span style=\"text-decoration: underline;\">Snake</span> - Clean your trumpet on a monthly basis. Use the snake for the inside of the trumpet with warm water (never hot) and mild soap.</li>\n<li><span style=\"text-decoration: underline;\">Mouthpiece brush</span> cleans your mouthpiece with warm (never hot) water and mild soap.</li>\n</ul>','Trumpet Maintenance',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,7),(124,10,4,1,1,1,'Page','2012-02-02 07:42:30','2012-02-07 04:31:44','trumpet-maintenance','Trumpet Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>Insert mouthpiece gently! Do not \"pop\" in with your hand or put excess pressure on mouthpiece. Simply twist gently into place.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Valve Oil</span> - Take each valve out and apply a few drops of oil before each time you play. This reduces friction, corrosion and prevents the valve from seizing so you can perform your best every time without having to stop to apply oil.</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li><span style=\"text-decoration: underline;\">Snake</span> - Clean your trumpet on a monthly basis. Use the snake for the inside of the trumpet with warm water (never hot) and mild soap.</li>\n<li><span style=\"text-decoration: underline;\">Mouthpiece brush</span>','Trumpet Maintenance',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,7),(125,11,4,1,1,1,'Page','2012-02-02 07:43:02','2012-02-07 04:32:14','clarinet-maintenance','Clarinet Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Pull- through</span> - This is basically a piece of string with a weight on one end which you drop down your instrument and pull the cloth on the other end through. All good music shops should sell these, or you can make one yourself!</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li><span style=\"text-decoration: underline;\">Cork Grease</span> - You will need to rub some cork grease on the cork parts of your instrument from time to time when you are setting it up. This needs to be done when your corks are dry to prevent them from cracking and breaking.</li>\n</ul>','Clarinet Maintenance',NULL,NULL,NULL,1,1,NULL,0,3,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,7),(126,12,3,1,1,1,'Page','2012-02-02 07:43:39','2012-02-07 04:32:44','saxophone-maintenance','Saxophone Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff, books music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Pull- through</span> - This is basically a piece of string with a weight on one end, which you drop down your instrument and pull the cloth on the other end through. All good music shops should sell these, or you can make one yourself!</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li><span style=\"text-decoration: underline;\">Cork Grease</span> - You will need to rub some cork grease on the cork parts of your instrument from time to time when you are setting it up. This needs to be done when your corks are dry to prevent them from cracking and breaking.</li>\n</ul>','Saxophone Maintenance',NULL,NULL,NULL,1,1,NULL,0,4,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,7),(127,13,3,1,1,1,'Page','2012-02-02 07:44:05','2012-02-07 04:33:15','flute-maintenance','Flute Maintenance',NULL,'<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>You will need:</p>\n<ul><li><span style=\"text-decoration: underline;\">Cleaning rod</span> - This generally comes in the case with the instrument when purchased.</li>\n<li><span style=\"text-decoration: underline;\">Cleaning cloth</span> - Used to wrap around the cleaning rod and to be wiped through your instrument after each use. A small hankerchief or similar can be used for this. This is an extremely important part of caring from your instrument to avoid moisture build up and to prevent breakdown of keypads etc, not to mention germs!!</li>\n<li><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the silver/ nickel on your instrument. It also makes your instrument clean and shiny!</li>\n</ul>','Flute Maintenance',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,7),(128,25,3,1,1,1,'Page','2012-02-02 21:13:16','2012-02-07 04:37:38','jamfactory-jaz-band','Jamfactory Jaz Band',NULL,'<li>All Blues </li>\n<li>All of Me </li>\n<li>American Patrol, The</li>\n<li>April in Paris</li>\n<li>Bandstand Boogie</li>\n<li>Basin Street Blues</li>\n<li>Birdland</li>\n<li>Beyond the Sea </li>\n<li>Blues Cruise, The</li>\n<li>Blue Skies</li>\n<li>Blue Train</li>\n<li>Boogie Woogie Bugle Boy </li>\n<li>Chameleon</li>\n<li>Coffee and Castanets</li>\n<li>Coogee Bay Stomp</li>\n<li>Chicawilla’s Groove</li>\n<li>Farm Cove</li>\n<li>Family Guy</li>\n<li>Fast Heat</li>\n<li>Freddie Freeloader</li>\n<li>Ghost Gum Groove</li>\n<li>Green Onions </li>\n<li>Grooved Pavement</li>\n<li>Grove City Groover, The</li>\n<li>Haitian Fight Song</li>\n<li>Hang On Sloopy</li>\n<li>Harlem Nocturne </li>\n<li>Hot Strip Shuffle</li>\n<li>I’m Beginning to See The Light</li>\n<li>In a Mellow Tone</li>\n<li>In a Sentimental Mood </li>\n<li>In The Midnight Hour</li>\n<li>In The Mood</li>\n<li>It Don’t Mean a Thing</li>\n<li>Jacaranda Jive</li>\n<li>Jalapeno Dreams</li>\n<li>Jumpin’ at the Woodside</li>\n<li>Kansas City </li>\n<li>Lulu’s Back in Town</li>\n<li>Minnie the Moocher</li>\n<li>Nice 