 stories her mother has to tell the band,</p>\n<p>thanks mum xoxo</p>','Bronwyn Cugley',NULL,NULL,NULL,1,1,NULL,0,7,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(197,47,5,1,1,1,'Page','2012-02-07 11:39:38','2012-02-07 11:41:48','bronwyn-cugley','Bronwyn Cugley',NULL,'<p><img class=\"left\" src=\"assets/bronwyn-cugley.jpg\" width=\"324\" height=\"483\" alt=\"\" title=\"\"/></p>\n<p>Bronwyn Cugley has played the Trumpet for the past 10 years.  Bronwyn has played with Kanwal Primary School band and Gorokan High School Wind Orchestra.  Bronwyn did play the Tuba for 12 months with Gorokan High School Wind Orchestra and assisted Gosford City Brass Band in their annual concert playing the Tuba.</p>\n<p>Bronwyn’s most memorable musical moment was performing on tour with Gorokan High School Wind Orchestra on the Outback tour in 2004.</p>\n<p>Bronwyn likes playing with WWP as it is a great environment to play music with all different types of people.  Bronwyn says she just loves being embarrassed by all the wonderful stories her mother has to tell the band,</p>\n<p><img class=\"left\" src=\"assets/smiley-smile.gif\" width=\"18\" height=\"18\" alt=\"\" title=\"\"/>thanks mum xoxo</p>','Bronwyn Cugley',NULL,NULL,NULL,1,1,NULL,0,7,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(198,46,4,1,1,1,'Page','2012-02-07 11:39:37','2012-02-07 11:42:43','peter-farthing','Peter Farthing',NULL,'<p><img class=\"left\" src=\"assets/peter-farthing.jpg\" width=\"324\" height=\"483\" alt=\"\" title=\"\"/></p>\n<p>Peter Farthing plays trumpet. He started playing at age 10 then played til he was 21 then won a scholarship at the Conservatorium of Sydney Opera School.</p>\n<p>Peter has played with such groups as Auburn/Lidcombe Youth Band, Marist Bros. Parramatta and Army Cadet Corp Band.</p>\n<p>His most memorable moment was at Bicentenial celebration - Singing in male chorus with Sydney Symphony Orchestra at Sydney Opera House in the recital of Opera Zrinski.</p>\n<p>\"My family has musical roots - my grandfather sang on the Tivoli theatre circuit and my mother was a soprano. Music and theatre has been a large part of my earlier life. I also studied acting at the Ensemble Theatre (independent) in Sydney and was lucky to have a trumpet mentor in Dick Montz.</p>\n<p>After not being involved in music or theatre for a long time, playing with Wallarah Winds and Percussion is like discovering myself again, funny how life can become a full circle - Love it !!</p>','Peter Farthing',NULL,NULL,NULL,1,1,NULL,0,8,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(199,45,4,1,1,1,'Page','2012-02-07 11:39:36','2012-02-07 11:43:49','alberto-castiglione','Alberto Castiglione',NULL,'<p><img class=\"left\" src=\"assets/alberto-castiglione.jpg\" width=\"226\" height=\"338\" alt=\"\" title=\"\"/></p>\n<p>Alberto Castiglione has been playing the trumpet for 15 months and never thought he could learn to play an instrument as an adult, this is something Alberto always wanted to do.</p>\n<p>Alberto enjoys getting together with other players each week, having fun and learning to play great music.</p>\n<p>Alberto’s most memorable musical moment with WWP is playing at the Toukley Food and Fun Festival at Toukley this year.</p>','Alberto Castiglione',NULL,NULL,NULL,1,1,NULL,0,9,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(200,44,4,1,1,1,'Page','2012-02-07 11:39:34','2012-02-07 11:44:23','madeleine-dow','Madeleine Dow',NULL,'<p>Madeleine Dow - aka Mad Maddie has been playing the Flute for 1 ½ years with Kanwal School Band.','Madeleine Dow',NULL,NULL,NULL,1,1,NULL,0,10,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(201,44,5,1,1,1,'Page','2012-02-07 11:39:34','2012-02-07 11:44:59','madeleine-dow','Madeleine Dow',NULL,'<p><img class=\"left\" src=\"assets/madeleine-dow.jpg\" width=\"324\" height=\"483\" alt=\"\" title=\"\"/></p>\n<p>Madeleine Dow - aka Mad Maddie has been playing the Flute for 1 ½ years with Kanwal School Band.','Madeleine Dow',NULL,NULL,NULL,1,1,NULL,0,10,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(202,43,4,1,1,1,'Page','2012-02-07 11:39:33','2012-02-07 11:46:00','john-saunders','John Saunders',NULL,'<p><img class=\"left\" src=\"assets/john-saunders2.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>John Saunders plays the Bass Clarinet but is known to play many other instruments such French Horn and Clarinet.</p>\n<p>John has been playing for many years and has played with Gorokan High School Wind Orchestra and Kanwal Primary School Band.  When asked if he has any nicknames John says “You would not believe the names I have attracted from my fine scholars”!!</p>\n<p>John is instrumental in tutoring other players, organising small ensembles and always helps out where he can.  There would be many musicians who can remember playing alongside Mr Saunders and it would not be the same without him there.</p>\n<p>John’s memorable musical moment is playing in a concert in Banff with Gorokan High School Wind Orchestra and enjoys playing with WWP as it brings people together who otherwise would not be playing.</p>','John Saunders',NULL,NULL,NULL,1,1,NULL,0,11,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(203,42,4,1,1,1,'Page','2012-02-07 11:39:32','2012-02-07 11:46:43','jean-britton','Jean Britton',NULL,'<p><img class=\"left\" src=\"assets/jean-britton2.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>Jean Britton with “Ernest” Euphonium has been playing with WWP since it began in 2008.</p>\n<p>Jean has been involved in music programs since 1998 when her eldest daughter, Bronwyn, joined Kanwal Public School Band.</p>\n<p>Jean first learnt to play the Tenor Horn with the Salvation Army in Grafton then moved onto the Baritone and Euphonium.  Jean has grown up with music learning to play the piano until age 16, did singing lessons to perform at competitions.Jean had not played any instruments for a long time (22 years) until Rowan finally let her play after she nagged him to near death.</p>\n<p>Mr Hibbard would let Jean play the trumpet every year at Toukley.  Jean has held various band committee positions with Kanwal Primary and Gorokan High School Bands and is currently President for WWP.</p>\n<p>WWP is Jean’s de-stressing therapy, to have fun, play and share great music and socialise with fellow musicians.  Jean has said for many years that we need a community band for all those musicians who have nowhere to play when they leave school – dreams do come true at last.</p>','Jean Britton',NULL,NULL,NULL,1,1,NULL,0,12,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(204,41,4,1,1,1,'Page','2012-02-07 11:39:30','2012-02-07 11:47:37','niall-waldron','Niall Waldron',NULL,'<p><img class=\"left\" src=\"assets/niall-waldron2.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>Niall Waldron plays percussion</p>','Niall Waldron',NULL,NULL,NULL,1,1,NULL,0,13,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(205,40,4,1,1,1,'Page','2012-02-07 11:39:27','2012-02-07 11:48:48','marita-castiglione','Marita Castiglione',NULL,'<p><img class=\"left\" src=\"assets/marita-castiglione4.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>Marita Castiglione has been playing the Clarinet for the past 2 years and played in her school band in 1979!!</p>\n<p>','Marita Castiglione',NULL,NULL,NULL,1,1,NULL,0,14,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(206,39,2,1,1,1,'Page','2012-02-07 11:39:05','2012-02-07 11:49:07','matt-kelly','Matt Kelly',NULL,NULL,'Matt Kelly',NULL,NULL,NULL,1,1,NULL,0,15,0,0,'Saved (new)',NULL,'Inherit','Inherit',NULL,32),(207,27,3,1,1,1,'Page','2012-02-02 21:14:32','2012-02-07 11:50:30','one-on-one-lessons','One-on-One Lessons',NULL,'<p>~ More information coming soon! ~</p>','One-on-One Lessons',NULL,NULL,NULL,1,1,NULL,0,3,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,6),(208,28,3,1,1,1,'Page','2012-02-02 21:15:01','2012-02-07 11:54:16','theory-classes','Theory Clas