 spare time he has been playing the Tuba for the last few month and boy what a difference that makes to the low brass section.</p>\n<p>Pat has played in heaps of bands previously - too many to list.</p>\n<p>His memorable musical moments include - playing with Elliot Randal (Guitarist) of Steely Dan and performing with an 8 piece band with own material at album launch.</p>\n<p>Pat likes playing with WWP as he is learning something new and it makes him approach music from a different angle and he gets to play alongside his daughter Madeleine.</p>\n<p>Pat has been a pro musician for almost 30 years and continues to enjoy his music no matter what it is.','Patrick Dow',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(214,1,5,1,1,1,'HomePage','2012-02-02 06:40:52','2012-02-10 04:42:50','home','Home',NULL,'<p>Blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blah</p>',NULL,NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,0),(215,1,6,1,1,1,'HomePage','2012-02-02 06:40:52','2012-02-10 05:09:41','home','Home',NULL,'<p>Blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blah</p>',NULL,NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,0),(216,1,7,1,1,1,'HomePage','2012-02-02 06:40:52','2012-02-10 05:12:01','home','Home',NULL,'<p>Blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blahblah blah</p>',NULL,NULL,NULL,NULL,1,1,NULL,0,1