li> Adult Lessons </li>\n<li> Music Theory </li>\n<li> Alternative/Rock Music </li>\n<li> Jazz &amp; Improvisation </li>\n</ul><h2>Instruments we specialise in:</h2>\n<ul><li> Woodwind Instruments </li>\n<li> Flute, Clarinet, Saxophone, Recorder. </li>\n<li> Brass Instruments </li>\n<li> Trumpet, Trombone, French Horn, Euphonium, Tuba. </li>\n<li> Percussion/ Drums </li>\n<li> Piano </li>\n<li> Guitar </li>\n</ul><h2><img class=\"left\" src=\"assets/scmlogosmall2.png\" width=\"131\" height=\"129\" alt=\"\" title=\"\"/></h2>\n<h2>Information for Schools</h2>\n<p>Concert bands are a great training ground for discipline, responsibility, cooperation, commitment and leadership.</p>\n<p>Being a member of a band is a great way to form lasting friendships and have a lot of fun!</p>\n<p>Band members also get lots of wonderful opportunities to participate in various tours, competitions, festivals and music camps.</p>\n<p>The focus of School and Community Music is to bring schools and communities together encouraging a broader outlook on local and international culture.</p>\n<h2>Benefits of Music Education</h2>\n<ul><li> Improves maths and language performance. </li>\n<li> Improves memory. </li>\n<li> Improves reasoning capacity and problem solving skills. </li>\n<li> Greater social and team skills. </li>\n<li> Enhances listening skills. </li>\n<li> Builds self- confidence.</li>\n</ul><h2><img class=\"left\" src=\"assets/scmlogosmall3.png\" width=\"84\" height=\"55\" alt=\"\" title=\"\"/></h2>\n<h2>Benefits of Adult Learning and/or Playing</h2>\n<h3>Social:</h3>\n<ul><li> Fun and friendship. </li>\n<li> Gives you the opportunity to help others by playing at fundraisers and charity gigs etc. This can be a very rewarding experience. </li>\n<li> Adds another dimension to your life and helps you grow personally. </li>\n<li> Brings families together in a fun, challenging environment! </li>\n</ul><h3>Educational:</h3>\n<ul><li> Learning to play both individually and together as a cohesive band. </li>\n<li> Provides you with a starting point to then specialise within the ensembles. E.g. Big Band, Jazz, Blues etc. </li>\n</ul>',NULL,NULL,NULL,NULL,1,1,NULL,0,7,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,0),(236,2,13,1,1,1,'Page','2012-02-02 06:40:52','2012-02-13 09:01:48','about-us','About Us',NULL,'<h2><img class=\"left\" src=\"assets/scmlogo2.png\" width=\"210\" height=\"271\" alt=\"\" title=\"\"/></h2>\n<h2>Giving Schools and the Community access to music performance and education in:</h2>\n<ul><li> School Bands </li>\n<li> Community Bands </li>\n<li> JAMFACTORY Jazz Band </li>\n<li> RIMFIRE! Percussion Ensemble </li>\n<li> Small Ensembles </li>\n</ul><h2>We provide tuition for:</h2>\n<ul><li> Group Tutorials </li>\n<li> One on One Lessons </li>\n<li> Adult Lessons </li>\n<li> Music Theory </li>\n<li> Alternative/Rock Music </li>\n<li> Jazz &amp; Improvisation </li>\n</ul><h2>Instruments we specialise in:</h2>\n<ul><li> Woodwind Instruments </li>\n<li> Flute, Clarinet, Saxophone, Recorder. </li>\n<li> Brass Instruments </li>\n<li> Trumpet, Trombone, French Horn, Euphonium, Tuba. </li>\n<li> Percussion/ Drums </li>\n<li> Piano </li>\n<li> Guitar </li>\n</ul><h2><img class=\"left\" src=\"assets/scmlogosmall2.png\" width=\"131\" height=\"129\" alt=\"\" title=\"\"/></h2>\n<h2>Information for Schools</h2>\n<p>Concert bands are a great training ground for discipline, responsibility, cooperation, commitment and leadership.</p>\n<p>Being a member of a band is a great way to form lasting friendships and have a lot of fun!</p>\n<p>Band members also get lots of wonderful opportunities to participate in various tours, competitions, festivals and music camps.</p>\n<p>The focus of School and Community Music is to bring schools and communities together encouraging a broader outlook on local and international culture.</p>\n<h2>Benefits of Music Education</h2>\n<ul><li> Improves maths and language performance. </li>\n<li> Improves memory. </li>\n<li> Improves reasoning capacity and problem solving skills. </li>\n<li> Greater social and team skills. </li>\n<li> Enhances listening skills. </li>\n<li> Builds self- confidence.</li>\n</ul><h2><img class=\"left\" src=\"assets/scmlogosmall3.png\" width=\"84\" height=\"55\" alt=\"\" title=\"\"/></h2>\n<h2>Benefits of Adult Learning and/or Playing</h2>\n<h3>Social:</h3>\n<ul><li> Fun and friendship. </li>\n<li> Gives you the opportunity to help others by playing at fundraisers and charity gigs etc. This can be a very rewarding experience. </li>\n<li> Adds another dimension to your life and helps you grow personally. </li>\n<li> Brings families together in a fun, challenging environment! </li>\n</ul><h3>Educational:</h3>\n<ul><li> Learning to play both individually and together as a cohesive band. </li>\n<li> Provides you with a starting point to then specialise within the ensembles. E.g. Big Band, Jazz, Blues etc. </li>\n</ul>',NULL,NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,0),(237,24,4,1,1,1,'Page','2012-02-02 21:13:05','2012-02-13 09:02:46','community-music','Community Music',NULL,'<p>blah blaha balhalshkdalhldkaslskdj</p>','Community Music',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,0),(238,24,5,0,1,0,'Page','2012-02-02 21:13:05','2012-02-13 09:03:34','community-music','Community Music',NULL,'<p>blah blaha balhalshkdalhldkaslskdj 2</p>','Community Music',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,0),(239,24,6,0,1,0,'Page','2012-02-02 21:13:05','2012-02-13 09:04:39','community-music','Community Music',NULL,'<p>blah blaha balhalshkdaasdasdas22222222222222222</p>','Community Music',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,0),(240,21,8,1,1,1,'Page','2012-02-02 09:10:42','2012-02-13 09:30:22','enrolment-and-enquiries','Enrolment and Enquiries','Enrolment','<p>Please print <a href=\"assets/180px-BeanSeller.png\" target=\"_blank\">