. Joseph\'s Catholic College','St. Joseph\'s College','<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Visit thier home page! <a href=\"http://www.sjcc.nsw.edu.au/default.php?pg=epages&amp;page=5\">St. Joseph\'s Catholic College</a></p>\n<h2>Rehearsal and tutorial times</h2>\n<p> </p>\n<h3>St. Joseph\'s Catholic College Band rehearses:</h3>\n<p>Monday: 8:00-9:00am</p>\n</div>','St. Joseph\'s Catholic College',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,14),(257,26,6,1,1,1,'Page','2012-02-02 21:13:49','2012-02-14 11:00:59','wallarah-winds-and-percussion','Wallarah Winds & Percussion',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p><img src=\"assets/wwplogo2.png\" width=\"153\" height=\"162\" alt=\"\" title=\"\"/></p>\n<p>Wallarah Winds &amp; Percussion is a local community band formed by Rowen McBride in 2008. The band consists of woodwind, brass and percussion players of all ages and is always after new members! </p>\n<p>WWP plays a wide range of repertoire spanning from hymns and chorales to jazz, orchestral arrangements and popular music.</p>\n<p> The band provides hymns annually at the Toukley RSL ANZAC Day dawn and morning services and is very proud to represent at these services. Other Regular performances include those at Camp Breakaway in San Remo, which provides respite for young people with disabilities, the elderly, people with dementia and their carers. WWP has also regularly supported the Cancer Coucil by performing at Relay for Life events.</p>\n<p> WWP is always looking for more performance oppurtunities so please contact us if you would like us at your next event !</p>\n<h2><img src=\"assets/cameraclipart_2.png\" width=\"150\" height=\"127\" alt=\"\" title=\"\"/> <a href=\"[sitetree_link id=29]\">Photos of Wallarah Winds &amp; Percussion</a></h2>\n</div>','Wallarah Winds and Percussion',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,24),(258,44,6,1,1,1,'Page','2012-02-07 11:39:34','2012-02-14 11:02:26','madeleine-dow','Madeleine Dow',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p><img src=\"assets/madeleine-dow.jpg\" width=\"324\" height=\"483\" alt=\"\" title=\"\"/></p>\n<p>Madeleine Dow - aka Mad Maddie has been playing the Flute for 1 ½ years with Kanwal School Band. </p>\n<p>Madeleine says she likes coming to WWP because she gets to do lots of cool things and learns heaps of music.Madeleine’s most musical moment was her first solo at the Kanwal School Band concert.  Madeleine is learning to play the Tuba and the recorder but would absolutely love to play the Oboe.  Well girlfriend newsflash you only have one mouth, two hands and you will need a very big bank loan to get an Oboe.  Aim high sell lots of chocolates or just get Dad to mortgage the house.</p>\n</div>','Madeleine Dow',NULL,NULL,NULL,1,1,NULL,0,10,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(259,40,5,1,1,1,'Page','2012-02-07 11:39:27','2012-02-14 11:02:53','marita-castiglione','Marita Castiglione',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p><img src=\"assets/marita-castiglione4.jpg\" width=\"243\" height=\"362\" alt=\"\" title=\"\"/></p>\n<p>Marita Castiglione has been playing the Clarinet for the past 2 years and played in her school band in 1979!!</p>\n<p> </p>\n<p>Marita’s most memorable musical moment was playing at the Anzac Dawn Service at Toukley this year.</p>\n<p> </p>\n<p>Marita enjoys playing with WWP as it is fun and challenging and they are a great bunch of people.</p>\n</div>','Marita Castiglione',NULL,NULL,NULL,1,1,NULL,0,14,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,32),(260,9,5,1,1,1,'Page','2012-02-02 07:41:29','2012-02-14 11:03:25','trombone-maintenance','Trombone Maintenance',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>Insert mouthpiece gently! Do not \"pop\" in with your hand or put excess pressure on mouthpiece. Simply twist gently into place.</p>\n<p>You must be gentle with the slide! Do not bump or drop the slide, even the smallest of dints can restrict slide movement or stop it from working.</p>\n<p>You will need:</p>\n<ul><li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Slide Cream</span> - Take the outer slide off being careful not to bump it, apply a <strong>small</strong> amount of cream to the end of the slide stocks. Put the outer slide back on the right way, ensuring the water key is facing down, and run it up and down a few times.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Spray Bottle</span> - Spray the slide regularly with water to keep it running smooth.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Snake</span> - Clean your trombone on a monthly basis. Use the snake for the inside of the slide using warm water (never hot) and mild soap.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Mouthpiece brush</span> - cleans your mouthpiece with warm (never hot) water and mild soap.</li>\n</ul></div>','Trombone Maintenance',NULL,NULL,NULL,1,1,NULL,0,1,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,7),(261,10,5,1,1,1,'Page','2012-02-02 07:42:30','2012-02-14 11:03:35','trumpet-maintenance','Trumpet Maintenance',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<p>Keep your instrument clean! Never chew gum, eat or drink immediately before or during playing. Sugar, food particles and other foreign objects may become difficult to dislodge resulting in poor performance and permanent damage to instrument.</p>\n<p>Do not stuff books, music or any other foreign materials into your case. This is a major cause of instrument damage.</p>\n<p>Insert mouthpiece gently! Do not \"pop\" in with your hand or put excess pressure on mouthpiece. Simply twist gently into place.</p>\n<p>You will need:</p>\n<ul><li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Valve Oil</span> - Take each valve out and apply a few drops of oil before each time you play. This reduces friction, corrosion and prevents the valve from seizing so you can perform your best every time without having to stop to apply oil.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Polishing Cloth</span> - To remove fingerprints and dirt/ marks that are left after playing. This is important because acids and dirt transferred from your hands can erode the brass on your instrument. It also makes your instrument clean and shiny!</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Snake</span> - Clean your trumpet on a monthly basis. Use the snake for the inside of the trumpet with warm water (never hot) and mild soap.</li>\n<li style=\"list-style: initial;\"><span style=\"text-decoration: underline;\">Mouthpiece brush</span> - cleans your mouthpiece with warm (never hot) water and mild soap.</li>\n</ul></div>','Trumpet Maintenance',NULL,NULL,NULL,1,1,NULL,0,2,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,7),(262,23,10,1,1,1,'Page','2012-02-02 09:12:21','2012-02-14 11:04:10','staff','Staff',NULL,'<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 62.5%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-height: 200px; margin: 8px;\">\n<h3>Rowen McBride</h3>\n<p>Conductor and brass tutor</p>\n<h3>Jessica McBride</h3>\n<p>Flute and saxophone tutor</p>\n<h3>Greg Smith</h3>\n<p>Piano and  theory</p>\n<h3>Matt Kelly</h3>\n<p>Trumpet tutor</p>\n<h3>Sean Cadogan-Steele</h3>\n<p>Percussion tutor</p>\n<h3>Paul Latham</h3>\n<p>Guitar tutor</p>\n</div>','Staff',NULL,NULL,NULL,1,1,NULL,0,5,0,0,'Saved (update)',NULL,'Inherit','Inherit',NULL,6),(263,8,7,1,1,1,'Page','2012-02-02 06:55:04','2012-02-14 11:04:20','useful-links','Useful Links',NULL,'<p>Sax and Woodwind - Brass and woodwind instruments and accessories<br style=\"color: #008000; font-family: arial, helvetica, sans-serif; font-size: 13px; line-height: 17px; text